-- ----------------------------
-- Function structure for `queryChildrenRateInfo`
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildrenRateInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `queryChildrenRateInfo`(rateId BIGINT) RETURNS varchar(4000) CHARSET latin1
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp = '$';
SET sTempChd = cast(rateId as char);

WHILE sTempChd is not NULL DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT group_concat(id) INTO sTempChd FROM tel_rate where FIND_IN_SET(active_id,sTempChd)>0;
END WHILE;
return sTemp;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `rateQueryChildrenInfo`
-- ----------------------------
DROP FUNCTION IF EXISTS `rateQueryChildrenInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `rateQueryChildrenInfo`(rateId BIGINT) RETURNS varchar(4000) CHARSET latin1
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);

SET sTemp = '$';
SET sTempChd = cast(rateId as char);

WHILE sTempChd is not NULL DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT group_concat(id) INTO sTempChd FROM rate_discount where FIND_IN_SET(active_id,sTempChd)>0;
END WHILE;
return sTemp;
END
;;
DELIMITER ;
